import React, {Component} from 'react';
import './StylingCss.css'

function StylingCss (props) {
    let theClass = props.primary ? 'primary' : ''
    return (
        <div>
            <h1 className={`${theClass} font-xl underline`}>Stylesheet</h1>

        </div>
    );
};

export default StylingCss;
